import React from "react";
import "./gameStyle.css";

const Tictactoe = () => {
  return (
    <div className="game__ticTacToe">
      <Board></Board>
    </div>
  );
};

function Board() {
  return <div className="game__board"> 
  <Cell></Cell>
  </div>;

}

function Cell(){
  return(
    <div className="game__cell"></div>
  );

}

export default Tictactoe;
